// src/pages/Home.js
import React from 'react';
import BlogList from '../components/BlogList';

function Home() {
  return (
    <div className="home">
      <h1>Welcome to My Blog</h1>
      <p>Here are my latest posts:</p>
      <BlogList />
    </div>
  );
}

export default Home;
